<!DOCTYPE html>
<html>
<head>
    <title>Lunar Retro-Alpha</title>
    <style>
        body { background: #050505; color: #33ff33; font-family: "Courier New", Courier, monospace; display: flex; flex-direction: column; align-items: center; height: 100vh; margin: 0; padding: 20px; box-sizing: border-box; overflow: hidden; text-shadow: 0 0 5px rgba(51, 255, 51, 0.8); }
        #terminal { 
            width: 50ch; max-width: 100%; flex-grow: 1; overflow-y: auto; 
            border: 1px solid #113311; padding: 20px; margin-bottom: 20px; 
            white-space: pre-wrap; position: relative; z-index: 1;
            background: linear-gradient(rgba(18, 16, 16, 0) 50%, rgba(0, 0, 0, 0.25) 50%), linear-gradient(90deg, rgba(255, 0, 0, 0.06), rgba(0, 255, 0, 0.02), rgba(0, 0, 255, 0.06));
            background-size: 100% 4px, 3px 100%;
            animation: flicker 0.15s infinite;
        }
        #terminal::before {
            content: " "; display: block; position: absolute; top: 0; left: 0; bottom: 0; right: 0;
            background: linear-gradient(rgba(18, 16, 16, 0) 50%, rgba(0, 0, 0, 0.1) 50%), linear-gradient(90deg, rgba(255, 0, 0, 0.05), rgba(0, 255, 0, 0.02), rgba(0, 0, 255, 0.05));
            z-index: 2; background-size: 100% 2px, 3px 100%; pointer-events: none;
        }
        @keyframes flicker {
            0% { opacity: 0.97; } 5% { opacity: 0.95; } 10% { opacity: 0.97; } 15% { opacity: 0.94; }
            20% { opacity: 0.98; } 25% { opacity: 0.95; } 30% { opacity: 0.97; } 35% { opacity: 0.94; }
            40% { opacity: 0.98; } 45% { opacity: 0.99; } 50% { opacity: 0.96; } 55% { opacity: 0.98; }
            60% { opacity: 0.95; } 65% { opacity: 0.99; } 70% { opacity: 0.97; } 75% { opacity: 0.94; }
            80% { opacity: 0.98; } 85% { opacity: 0.95; } 90% { opacity: 0.98; } 95% { opacity: 0.97; }
            100% { opacity: 0.98; }
        }
        .cursor { display: inline-block; width: 10px; height: 1.2em; background: #33ff33; vertical-align: middle; animation: blink 1s step-end infinite; }
        @keyframes blink { from, to { opacity: 1; } 50% { opacity: 0; } }
        #map-container { position: absolute; top: 20px; right: 20px; text-align: center; z-index: 10; }
        #map-canvas { width: 128px; height: 128px; image-rendering: pixelated; border: 1px solid #333; background: #000; }
        #map-label { font-size: 10px; margin-bottom: 5px; color: #666; }
        #input-area { width: 100%; max-width: 800px; display: flex; visibility: hidden; }
        #prompt { margin-right: 10px; }
        #command-input { background: transparent; border: none; color: #33ff33; font-family: inherit; font-size: inherit; flex-grow: 1; outline: none; }
        #overlay { position: fixed; top: 0; left: 0; width: 100%; height: 100%; background: rgba(0,0,0,0.95); display: flex; justify-content: center; align-items: center; z-index: 100; cursor: pointer; }
        #overlay-content { text-align: center; border: 2px solid #0f0; padding: 40px; }
    </style>
</head>

    </div>

        </div>
    </div>
    <div id="terminal"></div>
    <div id="input-area">
        <span id="prompt">&gt;</span>
        <input type="text" id="command-input" autocomplete="off">

        function updateRadar() {
             if (!wasmInstance) return;
             const active = wasmInstance.exports.getAlienActive();
             radarCtx.fillStyle = '#001100';
             radarCtx.fillRect(0, 0, 16, 16);
             radarCtx.fillStyle = '#003300';
             for(let i=0; i<16; i+=4) {
                 radarCtx.fillRect(i, 0, 1, 16);
                 radarCtx.fillRect(0, i, 16, 1);
             }
             if (active) {
                 const loc = wasmInstance.exports.getAlienPos();
                 const coords = [[2,1],[2,2],[3,2],[3,3],[6,1],[6,2],[7,2],[7,3],[10,1],[11,1],[11,2],[10,2],[14,2],[13,2],[13,1],[14,1],[0,0]];
                 if (loc < coords.length) {
                     const [x, y] = coords[loc];
                     if (x !== 0 || y !== 0) {
                         radarCtx.fillStyle = '#ff0000';
                         radarCtx.fillRect(x, y, 1, 1);
                     }
                 }
             }
        }

        function updateMap() {
            if (!wasmInstance) return;
            const prompt = document.getElementById('prompt');
            prompt.textContent = wasmInstance.exports.isInTerminal() ? 'MUTHUR>' : '>';

            const visitedPtr = wasmInstance.exports.getVisited();
            const currentLoc = wasmInstance.exports.getCurrentLoc();
            const visited = new Uint8Array(wasmInstance.exports.memory.buffer, visitedPtr, 17);
            mapCtx.clearRect(0, 0, 16, 16);
            const coords = [[2,1],[2,2],[3,2],[3,3],[6,1],[6,2],[7,2],[7,3],[10,1],[11,1],[11,2],[10,2],[14,2],[13,2],[13,1],[14,1],[0,0]];
            for (let i = 0; i < 17; i++) {
                if (visited[i]) {
                    const [x, y] = coords[i];
                    if (x === 0 && y === 0) continue; 
                    mapCtx.fillStyle = (i === currentLoc) ? '#fff' : '#0a0';
                    mapCtx.fillRect(x, y, 1, 1);
                }
            }
        }

        let currentColumn = 0;
        let wordBuffer = "";
        const WRAP_LIMIT = 50;

        function flushWord() {
            if (wordBuffer.length === 0) return;
            if (currentColumn + wordBuffer.length > WRAP_LIMIT) {
                terminal.textContent += "\n";
                currentColumn = 0;
            }
            terminal.textContent += wordBuffer;
            currentColumn += wordBuffer.length;
            wordBuffer = "";
        }

        function appendToTerminal(text) {
            cursor.remove();
            for (let char of text) {
                if (char === ' ' || char === '\n') {
                    flushWord();
                    if (char === ' ') {
                        if (currentColumn >= WRAP_LIMIT) {
                            terminal.textContent += "\n";
                            currentColumn = 0;
                        } else {
                            terminal.textContent += " ";
                            currentColumn++;
                        }
                    } else {
                        terminal.textContent += "\n";
                        currentColumn = 0;
                    }
                } else {
                    wordBuffer += char;
                }
            }
            flushWord();
            terminal.appendChild(cursor);
            terminal.scrollTop = terminal.scrollHeight;
        }

        function printText(ptr, len) {
            const memory = new Uint8Array(wasmInstance.exports.memory.buffer);
            const text = new TextDecoder().decode(memory.subarray(ptr, ptr + len));
            appendToTerminal(text);
        }

        async function printTerminal(ptr, len) {
            const memory = new Uint8Array(wasmInstance.exports.memory.buffer);
            const text = new TextDecoder().decode(memory.subarray(ptr, ptr + len));
            const tickPtr = wasmInstance.exports.getTerminalTickPtr();
            const tickLen = wasmInstance.exports.getTerminalTickLen();
            
            for (let i = 0; i < text.length; i++) {
                appendToTerminal(text[i]);
                if (text[i] !== ' ' && text[i] !== '\n') {
                    playSound(tickPtr, tickLen, false);
                }
                await new Promise(r => setTimeout(r, Math.random() * 10 + 5));
            }
        }

        function playSound(ptr, len, loop) {
            try {
                const memory = new Uint8Array(wasmInstance.exports.memory.buffer);
                const audioData = memory.slice(ptr, ptr + len);
                const blob = new Blob([audioData], { type: 'audio/ogg' });
                const url = URL.createObjectURL(blob);
                const audio = new Audio(url);
                audio.loop = !!loop;
                audio.play().catch(e => {});
                if (loop) activeLoops.push({ audio, url });
                else audio.onended = () => { URL.revokeObjectURL(url); audio.src = ''; };
                return { audio, url };
            } catch (e) { return null; }
        }

        function stopLoopingSounds() {
            activeLoops.forEach(l => { l.audio.pause(); URL.revokeObjectURL(l.url); l.audio.src = ''; });
            activeLoops = [];
        }

        function renderAnsi(data, targetCanvas) {
            const ctx = targetCanvas.getContext('2d');
            const colors = ['#000', '#f00', '#0f0', '#ff0', '#00f', '#f0f', '#0ff', '#fff', '#888'];
            for(let y=0; y<32; y++) {
                for(let x=0; x<32; x++) {
                    ctx.fillStyle = colors[data[y][x]];
                    ctx.fillRect(x, y, 1, 1);
                }
            }
        }

                stopLoopingSounds();
                const movePtr = wasmInstance.exports.getElevatorMovingPtr();
                const moveLen = wasmInstance.exports.getElevatorMovingLen();
                const loop = playSound(movePtr, moveLen, true);
                
                let level = 1;
                const interval = setInterval(() => {
                    if (wasmInstance.exports.isGameOver()) { clearInterval(interval); return; }
                    level++;
                    appendToTerminal(`\n[ ELEVATOR: PASSING LEVEL ${level}... ]\n`);
                    if (level >= 10) { 
                        clearInterval(interval); 
                        if (loop) { loop.audio.pause(); URL.revokeObjectURL(loop.url); }
                        const klonkPtr = wasmInstance.exports.getElevatorKlonkPtr();
                        const klonkLen = wasmInstance.exports.getElevatorKlonkLen();
                        playSound(klonkPtr, klonkLen, false);
                        wasmInstance.exports.arriveAtMine();
                    }
                }, 2000);
            } else if (id === 6) {
                showMonaLisa();
            } else if (id === 7) {
                stopLoopingSounds();
                const movePtr = wasmInstance.exports.getElevatorMovingPtr();
                const moveLen = wasmInstance.exports.getElevatorMovingLen();
                const loop = playSound(movePtr, moveLen, true);
                
                let count = 0;
                const interval = setInterval(() => {
                    if (wasmInstance.exports.isGameOver()) { clearInterval(interval); return; }
                    count++;
                    appendToTerminal(`\n[ ELEVATOR: ASCENDING... ]\n`);
                    if (count >= 10) { 
                        clearInterval(interval); 
                        if (loop) { loop.audio.pause(); URL.revokeObjectURL(loop.url); }
                        const klonkPtr = wasmInstance.exports.getElevatorKlonkPtr();
                        const klonkLen = wasmInstance.exports.getElevatorKlonkLen();
                        playSound(klonkPtr, klonkLen, false);
                        wasmInstance.exports.arriveAtLobby();
                    }
                }, 1000);
            }
        }

        function showMonaLisa() {
            overlay.style.display = 'flex';
            overlay.innerHTML = `<div id="overlay-content" style="border:none"><canvas id="art-canvas" width="32" height="32" style="width:512px; height:512px; image-rendering:pixelated; border:2px solid #daa520;"></canvas><p style="margin-top:20px; color:#daa520;">[ CLICK TO CLOSE ]</p></div>`;
            const ctx = document.getElementById('art-canvas').getContext('2d');
            const data = Array(32).fill(0).map(() => Array(32).fill(0));
            
            // Background (Dark Green/Black pattern)
            for(let y=0; y<32; y++) for(let x=0; x<32; x++) data[y][x] = (x+y)%2 === 0 ? 0 : 2;

            // Hair (Black)
            for(let y=5; y<25; y++) {
                data[y][10] = 0; data[y][11] = 0; 
                data[y][20] = 0; data[y][21] = 0;
            }
            for(let x=10; x<=21; x++) for(let y=5; y<10; y++) data[y][x] = 0;

            // Face (Yellow/Skin)
            for(let y=8; y<20; y++) for(let x=12; x<20; x++) data[y][x] = 3;
            
            // Eyes
            data[12][13] = 0; data[12][18] = 0;
            
            // Nose
            data[15][15] = 8; data[15][16] = 8;

            // Smile (The mysterious smile)
            data[17][13] = 0; data[17][18] = 0;
            data[18][14] = 0; data[18][15] = 0; data[18][16] = 0; data[18][17] = 0;

            // Neck/Chest
            for(let y=20; y<25; y++) for(let x=13; x<19; x++) data[y][x] = 3;
            
            // Dress (Dark Blue/Magenta)
            for(let y=25; y<32; y++) for(let x=8; x<24; x++) data[y][x] = 5;

            // Hands (crossed)
            for(let x=12; x<20; x++) { data[28][x] = 3; data[29][x] = 3; }

            renderAnsi(data, document.getElementById('art-canvas'));
            
            const closeHandler = () => {
                overlay.style.display = 'none';
                overlay.removeEventListener('click', closeHandler);
                input.focus();
            };
            overlay.addEventListener('click', closeHandler);
        }



        function showDeathScreen(type) {
            stopLoopingSounds();
            wasmInstance.exports.setGameOver();
            overlay.style.display = 'flex';
            let data = Array(32).fill(0).map(() => Array(32).fill(0));
            if (type === 3) { for(let i=0; i<32; i++) for(let j=0; j<32; j++) data[i][j] = 8; } 
            else if (type === 4) {
                // Alien face - use animation
                if (ALIEN_ANIMATION_DATA.length > 0) data = ALIEN_ANIMATION_DATA[0];
            }
            else { for(let i=25; i<32; i++) for(let j=0; j<32; j++) data[i][j] = 7; data[20][15] = 1; data[21][15] = 1; data[22][15] = 1; data[22][16] = 1; }
            
            let message = "LOST IN THE DEPTHS";
            if (type === 3) message = "THE VOID CONSUMES YOU";
            if (type === 4) message = "IT FOUND YOU";

            overlay.innerHTML = `<div id="overlay-content" style="border:none"><canvas id="death-canvas" width="32" height="32" style="width:512px; height:512px; image-rendering:pixelated; border:2px solid #f00;"></canvas><h1 style="color:#f00; margin-top:20px;">GAME OVER</h1><p>${message}</p><p style="margin-top:20px; font-size:12px; color:#666;">PRESS SPACE TO RESTART</p></div>`;
            renderAnsi(data, document.getElementById('death-canvas'));
            
            if (type === 4) {
                 let frame = 0;
                 const dCanvas = document.getElementById('death-canvas');
                 const animInterval = setInterval(() => {
                     if (overlay.style.display === 'none') { clearInterval(animInterval); return; }
                     if (ALIEN_ANIMATION_DATA.length > 0) {
                         renderAnsi(ALIEN_ANIMATION_DATA[frame % ALIEN_ANIMATION_DATA.length], dCanvas);
                     }
                     frame++;
                 }, 500);
                 
                 const dPtr = wasmInstance.exports.getAlienDeathPtr();
                 const dLen = wasmInstance.exports.getAlienDeathLen();
                 playSound(dPtr, dLen, false);
            } else {
                const dPtr = wasmInstance.exports.getElevatorDeathPtr();
                const dLen = wasmInstance.exports.getElevatorDeathLen();
                playSound(dPtr, dLen, false);
            }
            
            const restartHandler = (e) => {
                if (e.code === 'Space') {
                    document.removeEventListener('keydown', restartHandler);
                    location.reload();
                }
            };
            document.addEventListener('keydown', restartHandler);
        }

        async function initialize() {
            try {
                const bytes = Uint8Array.from(atob(WASM_BASE64), c => c.charCodeAt(0));
                const { instance } = await WebAssembly.instantiate(bytes, {
                    env: { printText, printTerminal, playSound, stopLoopingSounds, triggerSpecialSequence }
                });
                wasmInstance = instance;
                // Ensure arriveAtMine is linked if needed, but it is an export from WASM, so we don't need to import it into WASM.
                // We just call it.
                const ptr = wasmInstance.exports.getIntroSynthPtr();
                const len = wasmInstance.exports.getIntroSynthLen();
                playSound(ptr, len, true);
                overlay.innerHTML = `<div id="overlay-content"><h1>SYSTEMS INITIALIZED</h1><p style="margin-top: 40px; color: #0f0; cursor: pointer;">[ VIEW LOGS: 1955 EVENT ]</p></div>`;
                overlay.removeEventListener('click', initialize);
                overlay.addEventListener('click', playBackstory);
            } catch (err) { console.error(err); }
        }

        async function playBackstory() {
            overlay.removeEventListener('click', playBackstory);
            stopLoopingSounds();
            const ptr = wasmInstance.exports.getBackstoryPtr();
            const len = wasmInstance.exports.getBackstoryLen();
            playSound(ptr, len, false);
            overlay.innerHTML = `<div id="overlay-content" style="border:none"><canvas id="backstory-canvas" width="32" height="32" style="width:512px; height:512px; image-rendering:pixelated; border:2px solid #0f0;"></canvas></div>`;
            const bCanvas = document.getElementById('backstory-canvas');
            let frame = 0;
            const interval = setInterval(() => {
                if (frame >= ANIMATION_DATA.length) { clearInterval(interval); showStartScreen(); return; }
                renderAnsi(ANIMATION_DATA[frame++], bCanvas);
            }, 500);
        }

        function showStartScreen() {
            overlay.innerHTML = `<div id="overlay-content"><h1>LUNAR RETRO-ALPHA</h1><p>[ START MISSION ]</p></div>`;
            overlay.addEventListener('click', start);
        }

        async function start() {
            overlay.style.display = 'none'; inputArea.style.visibility = 'visible'; input.focus();
            try {
                stopLoopingSounds(); wasmInstance.exports.init(); updateMap();
                
                setInterval(() => {
                    if (wasmInstance.exports.isGameOver()) return;
                    wasmInstance.exports.tickWithSeed(1.0, Math.floor(Math.random() * 100000));
                    updateRadar();
                }, 1000);

                input.addEventListener('keydown', async (e) => {
                    if (e.key === 'Enter') {
                        const cmd = input.value.trim().toLowerCase(); input.value = '';
                        appendToTerminal(`\n> ${cmd}\n`);
                        if (cmd.startsWith("talk ") || cmd.startsWith("ask ")) {
                            const query = cmd.substring(5); appendToTerminal("[ CONTACTING MAINFRAME... ]\n");
                            try {
                                const response = await fetch('http://localhost:5000/chat', { method: 'POST', headers: { 'Content-Type': 'application/json' }, body: JSON.stringify({ message: query }) });
                                const data = await response.json(); appendToTerminal(`\nMAINFRAME: ${data.response}\n`);
                            } catch (err) { appendToTerminal("\n[ ERROR: CONNECTION LOST. ]\n"); }
                            return;
                        }
                        const encodedCmd = new TextEncoder().encode(cmd);
                        const ptr = wasmInstance.exports.getInputBuffer();
                        new Uint8Array(wasmInstance.exports.memory.buffer).set(encodedCmd, ptr);
                        wasmInstance.exports.onCommand(encodedCmd.length);
                        updateMap();
                        if (wasmInstance.exports.isGameOver()) {
                            stopLoopingSounds(); const p = wasmInstance.exports.getEndingSynthPtr(); const l = wasmInstance.exports.getEndingSynthLen(); playSound(p, l, false);
                        }
                    }
                });
            } catch (err) { console.error(err); }
        }
        overlay.addEventListener('click', initialize);
        document.addEventListener('click', () => { if (overlay.style.display === 'none') input.focus(); });
    </script>
</body>
</html>
